Ácido Mandélico 10% Gel 

O Ácido Mandélico é um alfa-hidroxiácido (AHA) com atividade antimicrobiana. Pode ser utilizado para reduzir rugas e linhas de expressão, combater e prevenir a acne e clarear manchas. É um ativo seguro para aplicação em todos os tons de pele.

Derivado da hidrólise do extrato de amêndoas amargas, o Ácido Mandélico é muito utilizado para o tratamento do fotoenvelhecimento, da acne e de hiperpigmentações. Além disso, possui ação antibacteriana. 

Indicado para todos os tons de pele, o produto possui efeito rápido e prolongado na aceleração da renovação epitelial, na autorregulação da produção de melanina, na produção, qualidade e quantidade de colágeno e glicosaminoglicanas. Além disso, também atua na proteção e no combate contra as bactérias, nos folículos pilosos e na produção sebácea.

Indicações:
- Renovação celular;
- Reduzir rugas e linhas de expressão;
- Reduzir hiperpigmentação;
- Tratar e prevenir a acne;
- Pré e pós peeling.
- Tratamento de estrias.

O que é e para que serve? 
Um absorvente externo de fluxo leve para uso durante o período menstrual.

Benefícios e diferenciais
- Com cápsulas superabsorventes que garantem rápida absorção e reduzem o contato com o fluxo;
- Até 6h de proteção contra vazamentos;
- Tecnologia exclusiva que neutraliza odores;
- Hipoalergênico e Ginecologicamente Testado;
- Cobertura Suave.

Como usar 
1) Retire a fita adesiva central do absorvente e das abas (se houver);
2) Fixe o absorvente no centro da calcinha, ajustando as abas por baixo da mesma. 

Precauções 
Todos os componentes são atóxicos em contato com a pele. Descontinuar o uso em caso de irritação. Não compre se a embalagem estiver violada. Conservar em local fresco e seco. Manter longe do alcance das crianças.

