O que é e para que serve? 
Um protetor diário sem fragância para usar todos os dias em que não estiver durante o período menstrual. CAREFREE® Todo dia é 100% respirável, flexível, absorve suor e fluidos natuais*, mantendo a área íntima seca e livre de odores.

Benefícios e diferenciais 
- 100% respirável para absorção de suor e fluidos naturais*;
- Não abafa a área íntima;
- Mantém a área íntima seca e arejada;
- Neutraliza odores;
- Hipoalergênico e ginecologicamente testado;

Como usar?
Descole a fita central e fixe o protetor diário no centro da calcinha. CAREFREE® Todo Dia deve ser trocado durante o dia, conforme necessidade de cada pessoa. 

Precauções 
Manter longe do alcance de crianças. Não compre se a embalgem estiver violada. Todos os componentes são atóxicos em contato com a pele. Descontinuar o uso em caso de irritação. Conservar em lugar fresco e seco. Não jogue no vaso sanitário. Utilize o cesto de lixo. 

*suor, sangramento de escape e outras secreções vaginais. Em casos de sensação  de ardência, coceira e/ou alterações no aspecto, cor, odor da secreção vaginal, consulte seu ginecologista.

TENA Pants Noturna é uma roupa íntima descartável e unissex de rápida absorção, proporcionando ao usuário máxima proteção durante toda a noite. É indicado para pessoas com mobilidade e com perdas de urina severa. Além disso, é muito confortável, segura e de fácil uso, como uma roupa interior (calcinha ou cueca). A excepcional segurança deve-se à sua tecnologia antivazamento, que tem um núcleo de alta absorção, que absorve rapidamente grandes quantidades de urina mantendo-a longe da pele, assim o usuário permanece seco, reduzindo significativamente o risco de irritações ou infecções cutâneas.
•	Barreiras protetoras - segurança máxima contra vazamentos; 
•	Núcleo de alta absorção - posicionado para dar segurança na posição deitada; controlador de odor - Sistema que neutraliza o risco de odores indesejáveis; 
•	Material macio suave ao contato com a pele, para um maior conforto; 
•	Elásticos suaves em volta da cintura permitindo uma adaptação perfeita ao corpo; 
•	Elásticos duplos nas pernas para um melhor conforto e segurança contra vazamentos; 
•	Costuras laterais removíveis para retirar o produto com maior facilidade

